import React from 'react';
import { useParams } from 'react-router-dom';
// import { collegeData } from './collegeData'; // move your collegeData to a separate file
import{ MadhyaPradeshColleges }from './MadhyaPradeshColleges';

const CollegeListPage = () => {
  const { stream } = useParams(); // get the stream from URL
  const colleges =  MadhyaPradeshColleges [stream] || [];

  return (
    <div style={{ padding: '20px' }}>
      <h1>{stream} Colleges</h1>
      <ul>
        {colleges.map((college, idx) => (
          <li key={idx}>
            {college.name} - {college.city}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CollegeListPage;
